PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE config (
    name text primary key,
    value text
);
CREATE TABLE shared (
    name text primary key,
    value text
);
CREATE TABLE voices (
    id integer primary key,
    loop bool,
    regenerate bool,
    target_volume real,
    post_volume real,
    once bool,
    uno bool,
    quantize bool,
    plays integer default 0,
    sections integer default 0,
    movements integer default 0,
    generator text
);
CREATE TABLE params (
    id integer primary key,
    name text,
    shortname text,
    input_type text,
    output_type text,
    value text,
    cooked text,
    voice_id integer,
    accepts text,
    instance_id integer
);
CREATE TABLE types (
    id integer primary key,
    name text,
    shortname text,
    output_type text,
    accepts text
);
CREATE TABLE generators (
    id integer primary key,
    name text,
    shortname text
);
COMMIT;
